import { faHeart } from "@fortawesome/free-solid-svg-icons";

// INPUT: onLike
//OUTPUT: movie to change liked

import React, { Component } from "react";

class Like extends Component {
  state = {
    like: false,
    classes: "fa fa-heart-o",
  };

  render() {
    // let classes = this.props.liked ? "fa fa-heart" : "fa fa-heart-o";

    return (
      <i
        className={this.props.liked ? "fa fa-heart" : "fa fa-heart-o"}
        aria-hidden="true"
        onClick={this.onLikeHandler}
      ></i>
    );
  }
}

export default Like;
